import Carousel from "react-multi-carousel";
import ProductsSlider from "./ProductsSlider";
import Product from "./Product";
export default class Products extends React.Component{

    render(){

        return(
            <React.Fragment>
                <div className="products container">
                    <div className="row">
                        <ProductsSlider products={this.props.productPromo}></ProductsSlider>
                        <ProductsSlider products={this.props.productRowFirst}></ProductsSlider>
                        <ProductsSlider products={this.props.productRowSecond}></ProductsSlider>
                        <ProductsSlider products={this.props.productRowThird}></ProductsSlider>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}
